import React from "react";

const ProjectsPage = () => {
  const projects = [
    {
      id: 1,
      title: "VASAVI BRINDHAVANAM III ",
      description: "Step into the enchanting world of Vasavi Brindavanam-iii through this captivating walk-through video, where nature's serenity and architectural beauty merge seamlessly. As you meander through the meticulously landscaped gardens and pathways, a sense of tranquility envelops you. The grand entrance, adorned with intricate details, sets the tone for the stunning surroundings. The wide, well-maintained roads guide you to discover the luxurious amenities, including a lavish clubhouse, fitness center, swimming pool, and recreational spaces. Vasavi Brindavanam-iii is a true haven, where every step unveils a paradise of beauty and elegance.",
      videoId: "0gzqbjvd-uk",

    },
    {
      id: 3,
      title: "Jitu Professional Saloon",
      description: "Step into opulence with our Jitu Salon walkthrough! Experience Unreal Engine 5.1's magic as you explore every lavish detail - from exquisite lighting to intricate textures. Day to night, immerse in luxury. ",
      videoId: "q1eiTE0Bip4",

      liveLink: "https://project2.com"
    },
    {
      id: 2,
      title: "TNR DVN",
      description: "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum",
      videoId: "E8x7b6xX4MU",

      liveLink: "https://project3.com"
    },
    {
      id: 4,
      title: "Weather Forecast App",
      description: "A weather application that provides real-time forecasts, interactive maps, and detailed weather information for locations worldwide.",
      videoId: "eIrMbAQSU34",

      liveLink: "https://project4.com"
    },
    {
      id: 5,
      title: "Portfolio Generator",
      description: "A tool that helps developers create and customize their professional portfolios with various templates and styling options.",
      videoId: "W6NZfCO5SIk",

      liveLink: "https://project5.com"
    },
    {
      id: 6,
      title: "Recipe Finder",
      description: "A recipe discovery platform with filtering capabilities, nutritional information, and meal planning features.",
      videoId: "PkZNo7MFNFg",

      liveLink: "https://project6.com"
    }
  ];

  const ProjectItem = ({ project }) => (
    <div className="bg-white rounded-lg shadow-xl overflow-hidden transition-transform duration-300 hover:scale-[1.02] mb-8">
      <div className="md:flex h-[400px]">
        <div className="md:w-1/3">
          <div className="h-full w-full">
            <iframe
              className="w-full h-full"
              src={`https://www.youtube.com/embed/${project.videoId}`}
              title={project.title}
              allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share"
              allowFullScreen
            />
          </div>
        </div>
        <div className="md:w-2/3 p-6">
          <h2 className="text-2xl font-bold text-gray-800 mb-3">{project.title}</h2>
          <p className="text-gray-600">{project.description}</p>
        </div>
      </div>
    </div>
  );

  return (
    <div className="min-h-screen bg-gray-100 py-12">
      <div className="mx-auto px-8 sm:px-16 md:px-24 lg:px-32 xl:px-40 max-w-[1920px]">
        <h1 className="text-4xl font-bold text-gray-800 mb-8">My Projects</h1>
        <div className="space-y-8">
          {projects.map((project) => (
            <ProjectItem key={project.id} project={project} />
          ))}
        </div>
      </div>
    </div>
  );
};

export default ProjectsPage;
